import React from "react";
import Exercise from "./ExerciseItem";

const ExerciseList = ( {Exercises,setExercises}) => {

    const exercisesDuration = () => {
        console.log("in func");
        let count = 0;
        Exercises.forEach((exercise) => {
            console.log(count);
            console.log(typeof(exercise.time))
            console.log(typeof(exercise.restTime))
            console.log(typeof(exercise.repeats))
            count+= (exercise.time + exercise.restTime) * exercise.repeats;
        })
        console.log(count)
        //consider removing one restTime from total count
        let displayCount = `${Math.trunc(count/60)}:${count%60} minutes`;
        return displayCount;
    }

    return(
        <div className="exercise-container">
            <ul className="exercise-list">
                <h1>Training List</h1>
                {Exercises.map((exercise) => (
                    <Exercise exercise={exercise} Exercises={Exercises} setExercises={setExercises} name={exercise.name} key={exercise.id} />
                ))}
                Current duration: {exercisesDuration()}
                {/* Remaining time to total: */}

            </ul>
        </div>
    );
};

export default ExerciseList;
